import React, { useState } from 'react';
import {
  Container,
  Paper,
  TextField,
  Button,
  Typography,
  Box,
  Alert,
  CircularProgress
} from '@mui/material';

const Login = ({ setUser }) => {
  const [formData, setFormData] = useState({
    email: '',
    password: '',
    role: 'student'
  });
  const [error, setError] = useState('');
  const [loading, setLoading] = useState(false);

  const API_BASE = 'http://localhost:5001';

  const handleSubmit = async (e) => {
    e.preventDefault();
    setLoading(true);
    setError('');

    try {
      const response = await fetch(`${API_BASE}/api/login`, {
        method: 'POST',
        headers: {
          'Content-Type': 'application/json',
        },
        body: JSON.stringify(formData),
      });

      const data = await response.json();

      if (response.ok) {
        localStorage.setItem('token', data.token);
        setUser(data.user);

        // Redirect based on role
        switch (data.user.role) {
          case 'admin':
            window.location.href = '/admin';
            break;
          case 'faculty':
            window.location.href = '/faculty';
            break;
          case 'student':
            window.location.href = '/student';
            break;
          default:
            window.location.href = '/dashboard';
        }
      } else {
        setError(data.error || 'Login failed');
      }
    } catch (err) {
      setError('Login failed. Please check if backend server is running.');
    } finally {
      setLoading(false);
    }
  };

  const testBackend = async () => {
    try {
      const response = await fetch(`${API_BASE}/api/health`);
      const data = await response.json();
      alert(`‚úÖ Backend connected! ${data.message}`);
    } catch (error) {
      alert('‚ùå Backend connection failed! Make sure server is running on port 5001');
    }
  };

  return (
    <Container maxWidth="sm">
      <Box sx={{ mt: 8 }}>
        <Paper elevation={3} sx={{ p: 4 }}>
          <Typography variant="h4" align="center" gutterBottom>
            Smart Classroom Login
          </Typography>

          <Button 
            variant="outlined" 
            fullWidth 
            sx={{ mb: 2 }}
            onClick={testBackend}
          >
            Test Backend Connection
          </Button>

          {error && <Alert severity="error" sx={{ mb: 2 }}>{error}</Alert>}

          <form onSubmit={handleSubmit}>
            <TextField
              fullWidth
              label="Email"
              variant="outlined"
              margin="normal"
              value={formData.email}
              onChange={(e) => setFormData({...formData, email: e.target.value})}
              required
              disabled={loading}
              placeholder="Enter your email"
            />

            <TextField
              fullWidth
              label="Password"
              type="password"
              variant="outlined"
              margin="normal"
              value={formData.password}
              onChange={(e) => setFormData({...formData, password: e.target.value})}
              required
              disabled={loading}
              placeholder="Enter your password"
            />

            <TextField
              fullWidth
              select
              label="Role"
              variant="outlined"
              margin="normal"
              value={formData.role}
              onChange={(e) => setFormData({...formData, role: e.target.value})}
              SelectProps={{ native: true }}
              disabled={loading}
            >
              <option value="student">Student</option>
              <option value="faculty">Faculty</option>
              <option value="admin">Admin</option>
            </TextField>

            <Button
              type="submit"
              fullWidth
              variant="contained"
              sx={{ mt: 3, mb: 2 }}
              size="large"
              disabled={loading}
            >
              {loading ? <CircularProgress size={24} /> : 'LOGIN'}
            </Button>
          </form>

          <Typography variant="body2" color="textSecondary" align="center" sx={{ mt: 2 }}>
            Test Credentials:
          </Typography>
          <Typography variant="caption" display="block" align="center">
            Student: student@school.com / password
          </Typography>
          <Typography variant="caption" display="block" align="center">
            Faculty: faculty@school.com / password
          </Typography>
          <Typography variant="caption" display="block" align="center">
            Admin: admin@school.com / password
          </Typography>

          <Box sx={{ mt: 2, p: 2, backgroundColor: '#f5f5f5', borderRadius: 1 }}>
            <Typography variant="body2" color="textSecondary" align="center">
              üí° Make sure your backend server is running on port 3001
            </Typography>
          </Box>
        </Paper>
      </Box>
    </Container>
  );
};

export default Login;
